c/head\u003e\\n\u003cbody\u003e\\n    \u003cheader\u003eGET - Green Energy Token\u003c/header\u003e\\n    \\n    \u003csection class=\\\"section\\\"\u003e\\n        \u003ch1\u003eWelcome to GET\u003c/h1\u003e\\n        \u003cp\u003eThe future of green energy and cryptocurrency combined.\u003c/p\u003e\\n        \u003ca href=\\\"#about\\\" class=\\\"btn\\\"\u003eLearn More\u003c/a\u003e\\n    \u003c/section\u003e\\n    \\n    \u003csection class=\\\"section\\\" id=\\\"about\\\"\u003e\\n        \u003ch2\u003eAbout GET\u003c/h2\u003e\\n        \u003cp\u003eGET (Green Energy Token) is a blockchain-powered cryptocurrency designed to promote renewable energy solutions and decentralized energy trading. Built on the Solana blockchain, GET ensures fast, low-cost transactions with Phantom as the preferred wallet.\u003c/p\u003e\\n    \u003c/section\u003e\\n    \\n    \u003csection class=\\\"section\\\" id=\\\"tokenomics\\\"\u003e\\n        \u003ch2\u003eTokenomics\u003c/h2\u003e\\n        \u003cp\u003eSupply: 500 Million GET\u003cbr\u003eDistribution: 50% Public, 25% Development, 15% Marketing, 10% Reserve\u003c/p\u003e\\n    \u003c/section\u003e\\n    \\n    \u003csection class=\\\"section\\\" id=\\\"roadmap\\\"\u003e\\n        \u003ch2\u003eRoadmap\u003c/h2\u003e\\n        \u003cp\u003ePhase 1: Token Launch on Solana\u003cbr\u003ePhase 2: Community Building\u003cbr\u003ePhase 3: Exchange Listings \u0026 Partnerships\u003cbr\u003ePhase 4: Green Energy Projects Integration\u003c/p\u003e\\n    \u003c/section\u003e\\n    \\n    \u003csection class=\\\"section\\\" id=\\\"how-to-buy\\\"\u003e\\n        \u003ch2\u003eHow to Buy\u003c/h2\u003e\\n        \u003cp\u003e1. Create a Phantom wallet\u003cbr\u003e2. Purchase SOL\u003cbr\u003e3. Swap for GET on a Solana-based decentralized exchange\u003c/p\u003e\\n    \u003c/section\u003e\\n    \\n    \u003cfooter\u003e\\n        \u003cp\u003e\u0026copy; 2025 GET - Green Energy Token. All Rights Reserved.\u003c/p\u003e\\n    \u003c/footer\u00
